import React from "react";

const SkillBar = ({ width, name }) => {
  return (
    <div className="skillContainer">
      <p>{name}</p>
      <div className="skill" style={{ width: `${width}%` }}>
        {name}
      </div>
    </div>
  );
};

export default SkillBar;
